import React, { Component } from 'react'
import { storeProducts } from "./data"

export default class CustomObj extends Component {
    constructor(props) {
        super(props)
        this.state = {
            store: storeProducts.data,
        }
    }

    render() {
        let store = this.state.store;
        var tempObj = {};
        var eleData = []

        Object.keys(store).forEach(function (k) {
            var val = store[k];
            var key = val['customer_name'];
            var ele = val['month'];

            if (!tempObj[key])
                tempObj[key] = [];
            // var eleData = []
            // var eleData = [
            //     val['month']:{
            //         "item_name":val['item_name']

            //     }
            // ]
            eleData[ele].push(val['item_name']);

            tempObj[key].push(eleData);

        });
        console.log("result :", tempObj);

        return (
            <>
                <h1>Hey</h1>
            </>
        )
    }
}
